import React, { useContext } from "react"
import { UserContext } from "../UserContext"

const Header = ({ children }) => {
  const { currentUser } = useContext(UserContext)
  return (
    <div>
      <div>I am header</div>
      {children}
    </div>
  )
}

export default Header
